import React from 'react';
import ReactDOM from 'react-dom';
import {Items} from './CarouselItems'//myJson
import CarouselItem from './CarouselItem'
import clothes from '../../../img/clothes.jpg'
import students from '../../../img/students.jpg'
import friends from '../../../img/friends.jpg'
import soldure from '../../../img/soldure.jpg'

class CarouselInner extends React.Component {
  constructor(props)
  {
    super(props);
  }

  render() {
    const carouselItems = Items.map((singleItem) =>
                      <CarouselItem item={singleItem} imgAlt={singleItem.imgAlt} />
                    );
    return (
      <div class="carousel-inner">
        {carouselItems}
      </div>
    );
  }
}

export default CarouselInner
